import React, { useState } from "react";
import Axios from "axios";
import 'bootstrap/dist/css/bootstrap.min.css';
import ButtonToolbar from 'react-bootstrap/ButtonToolbar';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import Form from 'react-bootstrap/Form';

function EditarPerfiles(){
    const [nombre, setNombre]=useState("");
    const [user, setUser]=useState("");
    const [password, setPassword]=useState("");
    const [email, setEmail]=useState("");
    const [telefono, setTelefono]=useState("");


    //Filtro de perfiles
    const [TipoFiltro, setTipoFiltro]=useState("");
    const [ValorFiltro, setValorFiltro]=useState("");

    const [empleadosList,setEmpleados] =useState([]);
    const [editar, setEditar]=useState(false);
    const [filtro, setFiltro]=useState(false);

    const RegistrarNuevoUsuario = () =>{
        if(nombre && user && password && email && telefono){   
            Axios.post("http://localhost:3001/createUsers", {
                nombre:nombre,
                user:email,
                password:password,
                email:email,
                telefono:telefono
            }).then(()=>{
                alert("Usuario registrado");
                getUsuarios();
            });    
        }
    }

    const getUsuarios = () =>{
        Axios.get("http://localhost:3001/usuarios").then((response)=>{
          setEmpleados(response.data);        
        });
    }

    const update = () =>{
        Axios.put("http://localhost:3001/update", {
            nombre:nombre,
            user:user,
            password:password,
            email:email,
            telefono:telefono,
        }).then(()=>{
            getUsuarios();
            limpiarCampos();
        });
    }

    const limpiarCampos = () =>{
        setNombre("");
        setUser("");
        setPassword("");
        setEmail("");
        setTelefono("");
    }

    const editarEmpleado = (val) => {
        setEditar(true);
        setNombre(val.nombre);
        setUser(val.user);
        setPassword(val.password);
        setEmail(val.email);
        setTelefono(val.telefono);
    }

    const deleteEmpleado = (id) =>{
        Axios.delete(`http://localhost:3001/delete/${id}`).then(()=>{
          alert("eliminado");
          getUsuarios();
          limpiarCampos();
        });
    }

    const activarFiltro = () =>{
        setFiltro(true);
    }

    const filtroConsulta = () =>{
        Axios.get(`http://localhost:3001/filtro/${TipoFiltro}/${ValorFiltro}`).then((response)=>{
            setEmpleados(response.data);
        });
    }

    return (
        <div className="App">
            <div className='datos'>
                <div>
                    <div className="card header">
                        Crear un nuevo usuario
                    </div>
                    <form className="row g-3">
                        <div className="col-md-4">
                            <label htmlFor="validationDefault01" className="form-label">Nombre:</label>
                            <input onChange={(event) =>{setNombre(event.target.value);}} type='text' value={nombre} className="form-control" id="validationDefault01" required/>
                        </div>
                        <div className="col-md-4">
                            <label htmlFor="validationCustom02" className="form-label">Contraseña:</label>
                            <input onChange={(event) =>{setPassword(event.target.value);}} type='password' value={password} className="form-control" id="validationDefault02" required/>
                        </div>   
                        <div className="col-md-4">
                            <label htmlFor="validationCustom03" className="form-label">Correo:</label>
                            <input onChange={(event) =>{setEmail(event.target.value);}} type='text' value={email} className="form-control" id="validationDefault03" required/>
                        </div>
                        <div className="col-md-4">
                            <label htmlFor="validationCustom04" className="form-label">Telefono:</label>
                            <input onChange={(event) =>{setTelefono(event.target.value);}} type='text' value={telefono} className="form-control" id="validationDefault04" required/>
                        </div>
                        <div className="card footer text-body-secondary">
                            <ButtonToolbar aria-label="Toolbar with button groups">
                            {
                                editar?<button className="btn btn-warning" onClick={update}>Actualizar</button>
                                :<button className="btn btn-success" onClick={RegistrarNuevoUsuario()}>Registrar</button>
                            }
                            </ButtonToolbar>
                        </div>
                    </form>  
                    <div className="card footer text-body-secondary">
                            <ButtonToolbar aria-label="Toolbar with button groups">
                                <button className="btn btn-info" onClick={getUsuarios}>Listar Empleados</button>
                                <button className="btn btn-warning" onClick={activarFiltro}>Filtros </button>
                            </ButtonToolbar>
                        {
                            filtro?<div className='datos'>
                                        <h4>Filtro</h4>
                                        <div className="col-md-4">
                                            <select name="" id="" onChange={(event) =>{setTipoFiltro(event.target.value);}}>
                                                <option value="nombre">Nombre</option>
                                            </select>
                                            <input onChange={(event) =>{setValorFiltro(event.target.value);}} type='text' value={ValorFiltro} className="form-control" id="validationDefault01" required/>
                                            <button className="btn btn-success" onClick={filtroConsulta}>Filtrar</button>
                                        </div>
                                    </div>
                            :null
                        }
                    </div>
                </div>
                <div className='listar'>
                        <table className="table table-striped">
                            <thead>
                                <tr>
                                    <th scope="col">Usuario</th>
                                    <th scope="col">Contraseña</th>
                                    <th scope="col">Email</th>
                                    <th scope="col">Telefono</th>
                                    <th scope="col">Nombre completo</th>
                                    <th scope="col">Acciones</th>
                                </tr>
                            </thead>
                                {
                                    empleadosList.map((val,key)=>{
                                        return <tr>
                                            <th scope="row">{val.user}</th>
                                            <td>{"****"} </td>
                                            <td>{val.email} </td>
                                            <td>{val.telefono} </td>
                                            <td>{val.nombre} </td>
                                            <td>
                                                <button type="button"
                                                onClick={()=> {
                                                editarEmpleado(val)     
                                                }}  
                                                className="btn btn-info">Editar</button>
                                                <button type="button" 
                                                        className="btn btn-danger"
                                                        onClick={()=>{
                                                            deleteEmpleado(val.id)}
                                                        }>Eliminar</button>
                                            </td>
                                        </tr>
                                    })
                                }
                            </table>
                </div>
            </div>
        </div>
    );
};

export default EditarPerfiles;
